export interface IconsProps {
  name: 'folder' | 'excel' | 'word' | 'js' | 'ts' | 'jsx' | 'tsx' | 'gitignore' | 'markdown' | 'image' | 'left' | 'right' | 'zip' | 'css' | 'vue' | 'less' | 'html' | 'sass' | 'styl' | 'video' | 'audio' | 'text' | 'app' | 'setting' | 'java' | 'python' | 'font' | 'json' | 'loading' | 'empty'
  size?: number
  width?: number | string
  style?: React.CSSProperties
  color?: string
  onClick?(): void
  className?: string
}

export const iconMap: Record<IconsProps["name"], React.FC<any>> = {
  folder: Folder,
  excel: Excel,
  word: Word,
  js: Js,
  ts: Ts,
  jsx: Jsx,
  tsx: Tsx,
  gitignore: Git,
  markdown: Markdown,
  image: Image,
  left: ArrowLeft,
  right: ArrowRight,
  zip: Zip,
  css: Css,
  vue: Vue,
  less: Less,
  html: Html,
  sass: Sass,
  styl: Stylus,
  video: Video,
  audio: Audio,
  text: Text,
  app: App,
  setting: Setting,
  java: Java,
  python: Python,
  font: Font,
  json: Json,
  loading: Loading,
  empty: Empty,
}

const Icons: FC<IconsProps> = props => {
  const { name, size, className, style, onClick = () => { }, color } = props

  const MatchIcon = iconMap[name] || (() => null)
  return (
    <span
      style={{ fontSize: size, ...style }}
      onClick={onClick}
      className={classnames(`${prefixCls}-icon`, className)}
    >
      <MatchIcon color={color} />
    </span>
  )
}

export default Icons
